import React, { useEffect, useState } from 'react';
import { Container, Card, Button, Table, Form, Spinner } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [learners, setLearners] = useState([]);
  const [loading, setLoading] = useState(false);
  const [searchRollNo, setSearchRollNo] = useState('');
  const [filteredLearners, setFilteredLearners] = useState([]);

  const handleSearch = () => {
    if (!searchRollNo) return;
    setLoading(true);
    fetch('https://sheetdb.io/api/v1/131pnl5khpeib')
      .then((res) => res.json())
      .then((data) => {
        const filtered = data.filter(
          (learner) => learner.RollNo && learner.RollNo.trim() === searchRollNo.trim()
        );
        setFilteredLearners(filtered);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching learner data:', err);
        setLoading(false);
      });
  };

  return (
    <Container className="mt-5">
      <Card className="p-4 shadow-sm">
        <h2 className="text-center mb-4">🎓 Admin Learner Lookup</h2>

        <Form className="d-flex justify-content-center mb-4">
          <Form.Control
            type="text"
            placeholder="Enter Roll Number"
            value={searchRollNo}
            onChange={(e) => setSearchRollNo(e.target.value)}
            className="me-3 w-50"
          />
          <Button variant="primary" onClick={handleSearch}>🔍 Search</Button>
        </Form>

        {loading ? (
          <div className="text-center">
            <Spinner animation="border" variant="primary" />
          </div>
        ) : filteredLearners.length > 0 ? (
          <>
            <h5 className="mb-3">Learner Performance Report</h5>
            <Table striped bordered hover responsive size="sm">
              <thead>
                <tr>
                  <th>Roll No</th>
                  <th>Name</th>
                  <th>Batch</th>
                  <th>Physics</th>
                  <th>Chemistry</th>
                  <th>Botany</th>
                  <th>Zoology</th>
                  <th>Total</th>
                  <th>%</th>
                  <th>Rank</th>
                </tr>
              </thead>
              <tbody>
                {filteredLearners.map((learner, idx) => (
                  <tr key={idx}>
                    <td>{learner.RollNo}</td>
                    <td>{learner.StudentName}</td>
                    <td>{learner.Batch}</td>
                    <td>{learner.Physics}</td>
                    <td>{learner.Chemistry}</td>
                    <td>{learner.Botany}</td>
                    <td>{learner.Zoology}</td>
                    <td>{learner.Total}</td>
                    <td>{learner.Percentage}</td>
                    <td>{learner.Rank}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </>
        ) : (
          searchRollNo && <div className="text-center text-danger">No data found for Roll No: {searchRollNo}</div>
        )}

        <div className="text-center mt-4">
          <Button
            variant="secondary"
            onClick={() => navigate('/')}
          >
            🔙 Back to Learner Login
          </Button>
        </div>
      </Card>
    </Container>
  );
};

export default AdminDashboard;
